import Vue from 'vue';
import Router from 'vue-router';
import Home from "./views/Home.vue";
import Job from "./views/jop";
Vue.use(Router);
export default new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [{
    path: '/',
    name: 'home',
    component: Home,
    redirect: '/job',
    children: [{
      path: '/dream',
      name: 'dream',
      component: function component() {
        return import("./views/dream.vue");
      }
    }, {
      path: '/discuss',
      name: 'discuss',
      component: function component() {
        return import("./views/discuss.vue");
      }
    }, {
      path: '/job',
      name: 'job',
      component: Job
    }]
  }]
});
